import { Global, css } from '@emotion/core'

import { Header } from '../header';
import { Footer } from '../footer';

import {
  StyledLayout,
  LinesWrapper,
  Lines,
  MainLayout,
} from './layout.styles'

const globalStyles = css`
  body {
    overflow-x: hidden;
    overflow-y: auto;
    background-color: #071832;
    * {
      font-family: Space Mono,monospace;
      font-weight: 400;
    }
  }
`


export const Layout = ({children}) => {
  return (
    <>
      <Global styles={globalStyles} />
      <StyledLayout>
        <LinesWrapper>
          <Lines />
          <Lines />
          <Lines />
          <Lines />
          <Lines />
        </LinesWrapper>
        <Header />
        <MainLayout>
          {children}
        </MainLayout>
        <Footer />
      </StyledLayout>
    </>
  )
}
